import React from "react";
import Logo from "../assets/logo.png";

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="leftside">
        <img src={Logo} />
      </div>
      <div className="rigthside"></div>
    </div>
  );
};

export default Navbar;
